// src/pages/Login.js (Aesthetic Pink Theme)
import React, { useState } from "react";
import { 
    Box, 
    Typography, 
    TextField, 
    Button, 
    Paper, // Added Paper for a contained look
    InputAdornment, // Added InputAdornment for icons
} from "@mui/material";
import { 
    Lock as LockIcon, 
    Person as PersonIcon,
    Cake as CakeIcon // New icon for aesthetic touch
} from '@mui/icons-material';
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";

// Define the custom pink palette
const PINK_THEME = {
    primary: '#FF69B4', // Hot Pink / Main Accent
    secondary: '#FFC0CB', // Light Pink / Background Accent
    dark: '#A00045', // Dark Berry / Text Contrast
    lightBg: '#FFF0F5', // Very light background
};

export function Login({ onLogin }) {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const navigate = useNavigate();

    const handleSubmit = async () => {
        if (!username || !password) {
            alert("Please enter username and password");
            return;
        }

        try {
            const res = await axios.post("http://localhost:8080/api/user/login", {
                username,
                password,
            });

            // Backend sends STRING response like "Login successful"
            if (typeof res.data === "string") {
                alert(res.data);

                // If it's NOT successful, stop
                if (!res.data.toLowerCase().includes("successful")) return;
            }

            // Fetch the full user details after success
            const userRes = await axios.get(
                `http://localhost:8080/api/user/${username}`
            );

            const user = userRes.data; // {id, username, role}

            // Save logged-in user
            localStorage.setItem("currentUser", JSON.stringify(user));
            onLogin(user);

            // Redirect based on role
            if (user.role === "ADMIN") navigate("/admin");
            else navigate("/cart");

        } catch (error) {
            console.error(error);
            alert("Login failed. Please try again.");
        }
    };

    return (
        // Main container with light pink background
        <Box 
            sx={{ 
                pt: 8, 
                pb: 10, 
                minHeight: '100vh', 
                bgcolor: PINK_THEME.lightBg,
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'flex-start',
            }}
        >
            {/* Login form container (Paper) */}
            <Paper 
                elevation={10} 
                sx={{ 
                    maxWidth: 400, 
                    width: '90%',
                    p: 4, 
                    borderRadius: 4, // Large border radius
                    bgcolor: 'white',
                    textAlign: 'center',
                    border: `3px solid ${PINK_THEME.secondary}`,
                }}
            >
                {/* Title */}
                <Typography 
                    variant="h4" 
                    sx={{ 
                        mb: 4, 
                        fontWeight: 'bold', 
                        color: PINK_THEME.primary, 
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'center',
                    }}
                >
                    <CakeIcon sx={{ mr: 1, fontSize: '2rem' }} /> Sweet Login
                </Typography>

                {/* Username Field */}
                <TextField
                    label="Username"
                    fullWidth
                    value={username}
                    onChange={(e) => setUsername(e.target.value)}
                    sx={{ mb: 3 }}
                    InputProps={{
                        startAdornment: (
                            <InputAdornment position="start">
                                <PersonIcon sx={{ color: PINK_THEME.primary }} />
                            </InputAdornment>
                        ),
                    }}
                    // Add pink styling for aesthetic focus
                    color="primary" 
                    focused
                />

                {/* Password Field */}
                <TextField
                    label="Password"
                    type="password"
                    fullWidth
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    sx={{ mb: 4 }}
                    InputProps={{
                        startAdornment: (
                            <InputAdornment position="start">
                                <LockIcon sx={{ color: PINK_THEME.primary }} />
                            </InputAdornment>
                        ),
                    }}
                    // Add pink styling for aesthetic focus
                    color="primary"
                    focused
                />

                {/* Login Button */}
                <Button 
                    variant="contained" 
                    fullWidth 
                    onClick={handleSubmit}
                    sx={{
                        py: 1.5,
                        fontSize: '1.1rem',
                        fontWeight: 'bold',
                        bgcolor: PINK_THEME.primary, // Hot Pink button
                        '&:hover': {
                            bgcolor: '#F06292', // Slightly darker pink on hover
                            transform: 'scale(1.01)',
                        }
                    }}
                >
                    Sign In to the Bakery
                </Button>

                {/* Register Link */}
                <Typography sx={{ mt: 3, color: PINK_THEME.dark }}>
                    Don't have an account? 
                    <Link 
                        to="/register" 
                        style={{ 
                            color: PINK_THEME.primary, 
                            fontWeight: 'bold', 
                            textDecoration: 'none' 
                        }}
                    >
                        &nbsp;Register here
                    </Link>
                </Typography>
            </Paper>
        </Box>
    );
}

